<!DOCTYPE html>
<html>
<head>
<meta content='text/html; charset=UTF-8' http-equiv='Content-Type'>
<meta charset='utf-8'>

<meta content='width=device-width, initial-scale=1, shrink-to-fit=no' name='viewport'>
<title>benchmark-driver</title>
<link href="https://maxcdn.bootstrapcdn.com/bootstrap/3.3.7/css/bootstrap.min.css" rel="stylesheet" />
<link href="/stylesheets/site.css" rel="stylesheet" />
<script src="https://code.highcharts.com/highcharts.src.js"></script>
<script src="https://ajax.googleapis.com/ajax/libs/jquery/3.2.1/jquery.min.js"></script>
</head>
<body>
<nav class='navbar'>
<div class='container'>
<a href="/" class="navbar-brand">benchmark-driver.github.io</a>
<div class='collapse navbar-collapse'>
<ul class='nav navbar-nav navbar-right'>
<li>
<a href="/benchmarks.html">Benchmarks</a>
</li>
</ul>
</div>
</div>
</nav>
<div class='container'>
<div class='benchmark_page'>
<div class='text-center'>
<h1>MJIT Benchmarks</h1>
</div>
<div data-versions='[&quot;2.0.0-p648&quot;,&quot;2.1.10&quot;,&quot;2.2.9&quot;,&quot;2.3.6&quot;,&quot;2.4.3&quot;,&quot;2.5.0&quot;]' id='graph_metadata'></div>
<div class='benchmark_graph' data-values='[20.814,20.288,21.249,21.593,21.506,20.811]' id='aread'></div>
<div class='benchmark_graph' data-values='[41.206,38.846,41.612,40.821,39.22,41.494]' id='aref'></div>
<div class='benchmark_graph' data-values='[71.945,52.641,53.461,54.465,51.699,50.114]' id='aset'></div>
<div class='benchmark_graph' data-values='[24.024,23.067,26.157,31.177,22.7,22.195]' id='awrite'></div>
<div class='benchmark_graph' data-values='[24.512,25.395,25.481,24.013,21.751,21.69]' id='call'></div>
<div class='benchmark_graph' data-values='[62.097,58.026,62.018,68.15,60.267,57.594]' id='const2'></div>
</div>
<script>
  $(function () {
    var versions = $('#graph_metadata').data('versions');
  
    $('.benchmark_graph').each(function() {
      var id = $(this).attr('id');
      Highcharts.chart(id, {
        chart: {
          type: 'column'
        },
        title: {
          text: id
        },
        yAxis: {
          title: {
            text: 'Seconds'
          }
        },
        xAxis: {
          categories: versions
        },
        series: [{
          name: id,
          data: $(this).data('values')
        }]
      });
    });
  });
</script>

</div>

</div>

</body>
</html>
